import React from "react";

export default function Button(props:{ handleClick: any}) {
  return (
    <div>
      <button onClick={props.handleClick}>Get Characters</button>
      {/* <button onClick={props.handleClickCreators}>Get Creators</button>; */}
    </div>
  );
}
